@ti.func
def cal_f(i:int,T:float,y:float) -> float:
    f = 0.0
    if   i == 0: f = f_LIQUID(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
    elif i == 1: f = f_FCC_A1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
    return f

@ti.func
def cal_fyy(a:int,j:int,T:float,y:float) -> float:
    fyy = 0.0
    if   a == 0: # if sublattice 1 in LIQUID
        if   j == 0: fyy = fyy_LIQUID_AL1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 1: fyy = fyy_LIQUID_CO1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 2: fyy = fyy_LIQUID_CR1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 3: fyy = fyy_LIQUID_CU1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 4: fyy = fyy_LIQUID_FE1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 5: fyy = fyy_LIQUID_HF1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 6: fyy = fyy_LIQUID_MN1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
        elif j == 7: fyy = fyy_LIQUID_MO1(T,y[0,0],y[0,1],y[0,2],y[0,3],y[0,4],y[0,5],y[0,6],y[0,7])
    elif a == 1: # if sublattice 1 in FCC_A1
        if   j == 0: fyy = fyy_FCC_A1_AL1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 1: fyy = fyy_FCC_A1_CO1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 2: fyy = fyy_FCC_A1_CR1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 3: fyy = fyy_FCC_A1_CU1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 4: fyy = fyy_FCC_A1_FE1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 5: fyy = fyy_FCC_A1_HF1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 6: fyy = fyy_FCC_A1_MN1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
        elif j == 7: fyy = fyy_FCC_A1_MO1(T,y[1,0],y[1,1],y[1,2],y[1,3],y[1,4],y[1,5],y[1,6],y[1,7])
    return fyy

